import React from 'react';
import CampaignComparison from './CampaignComparison';
import CampaignMetrics from './CampaignMetrics';

const CampaignDashboard = () => {
  return (
    <div>
      <CampaignMetrics />
      <CampaignComparison />
    </div>
  );
};

export default CampaignDashboard;
